【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ いつでもどこでも使える、軽量・コンパクトサイズ<br />このサイズに、モバイルプリンターに求められる機能を集約。ビジネスバッグに入れてラクに持ち歩けるので、訪問先や商談のテーブルなど、さまざまなビジネスシーンで活躍します。<br /><br />★ 使用スタイルで選べる、充電・給電方式<br />PCから充電できるだけでなく、モバイルバッテリーからも給電可能。アポイントの合間や移動中に、充電・給電できるので、外回りのビジネスに安心して持ち歩けます。<br /><br />★ Wi-Fi対応だからケーブルレスで印刷<br />Wi-Fi対応なので、訪問先のオフィスでWi-Fi環境があれば、スマートフォンやタブレットのデータをその場でプリントできます。さらに、Wi-Fi Directにも対応しているので、ルーターが無い環境でもケーブルレスでプリントできます。<br /><br />★ モバイルだからこそ、顔料インクを<br />耐水性に優れた顔料インクを全色に採用。雨や商談中に飲み物などで書類が濡れてしまってもにじみにくいので、ビジネス文書のプリントに適しています。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* プリント方式：インクジェット（MACH）方式<br />* 解像度：最高5760×1440dpi<br />* インク/トナー：4色（黒インクカートリッジ、カラー3色一体型インクカートリッジ）<br />* 印刷スピード：<br />　・モノクロ：<br />　　…ACアダプター使用時：約7.0ipm（A4縦）、PPM最速値　約14枚/分<br />　　…バッテリー駆動時：約3.5ipm（A4縦) 、PPM最速値　約6.5枚/分<br />　・カラー：<br />　　…ACアダプター使用時：約4.0ipm（A4縦）、PPM最速値　約11枚/分<br />　　…バッテリー駆動時：約2.0ipm（A4縦）、PPM最速値：約5.3枚/分<br />* ファーストプリント時間（A4）：<br />　・ACアダプター使用時：カラー約25秒、モノクロ約14秒<br />　・バッテリー駆動時：カラー約40秒、モノクロ約22秒<br />* コントロールコード体系/プリンティングシステム：ESC/P-R<br />* インターフェイス：Hi-Speed USB、IEEE802.11b/g/n<br />* LCDパネル：1.44インチ カラー<br />* 用紙サイズ：背面MPトレイ：<br />　・単票紙：A6～A4/リーガル/レター/六切/ハイビジョン/名刺/KG/2L判/L判/ユーザー定義サイズ（幅55.0～210mm×長さ91.0～355.6mm）<br />　※坪量：64～300g/m2<br />　・ハガキ：ハガキ/往復ハガキ<br />　・封筒：洋形封筒1～4号、長形封筒3号/4号<br />* 給紙方法：背面MPトレイ<br />* 給紙容量：<br />　・普通紙：最大20枚（64g/m2普通紙使用時）<br />　・ハガキ：最大5枚<br />　・写真用紙：最大5枚<br />　・封筒：最大1枚<br />* 排紙方法：フェースアップ<br />* 動作音：45dB(A)（普通紙 / デフォルト）<br />* ランニングコスト：約12.9円(A4カラー文書）<br />* バッテリー：印刷枚数（A4 標準）：モノクロ約100枚、もしくはカラー約50枚（満充電時の初期値）<br />* 外形寸法（幅×奥行×高さ）：<br />　・収納時：309×154×61（mm）<br />　・使用時：309×232×217（mm）<br />* 質量（本体のみ、消耗品含む）：約1.6kg<br />* 主な添付品：セットアップ用インクカートリッジ（黒、カラー）、ACアダプター、電源コード、マイクロUSBケーブル（約0.8 m）、メンテナンスボックス（2個：1個本体に装着済）、ソフトウェアディスク、クイックガイド（冊子）、準備ガイド（シート）、保証書</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
