【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 高速MACHヘッドとブラック2列のノズル構成で高速印刷<br />3列のノズル構成を採用し、うち2列をブラックに配列。モノクロの印刷速度については、最速約30枚/分と高パフォーマンスを実現しています。カラー印刷についても、少ないノズル配分ながらエプソンが誇る高速MACHヘッドのインク吐出パフォーマンスにより、最速で約17枚/分を実現しています。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>仕様</h3><p>* 本体サイズmm : 【使用時】616×797×415(mm)、【収納時】616×322×214(mm)<br />* 本体重量 : 約12.0Kg<br />* 消費電力 : 【動作時】約26W、【スリープモード時】約1.3W<br />* 付属品 : セットアップ用インクカートリッジ、(ブラック×2個、シアン、マゼンタ、イエロー各1個)、取扱説明書、EPSONソフトウェアCD-ROM、Blu-rayTM/DVD/CDトレイ、8cmBlu-rayTM/DVD/CDアタッチメント、保証書<br />* 解像度 : 5760×1440dpi※最小1/5,760インチのドット間隔で印刷します。<br />* カラー印刷速度(枚/分) : A4サイズ:17枚/分<br />* モノクロ印刷速度(枚/分) : A4サイズ:30枚/分<br />* 用紙サイズ : 【リアASF】L判/2L判/KG/ハイビジョンサイズ/六切/四切/A6縦～A3ノビ縦、ユーザー定義サイズ:幅89.0～、329.0mm×長さ127.0～1,117.6mm、厚さ:普通紙 0.08～0.11mm、純正プリンター用紙 最大0.30mm、ハガキ:ハガキ、往復ハガキ※折り目がないもの。封筒:洋形封筒1号～4号※宛名面のみ印刷可能。長形封筒3号/4号(注6)、角形封筒2号※Windowsのみ対応。<br />* 給紙容量 : 【リアASF】A4:最大100枚(75g/m2普通紙使用時)、ハガキ:最大50枚<br />* インターフェイス : Hi-Speed USB×1※Hi-Speed USBでのご使用は、パソコン側でHi-Speed USBに対応している必要があります。また、Hi-Speed USBインターフェイスはUSB完全上位互換ですので、USBとしてご使用可能です。<br />* 対応OS : 【Windows】7(32bit・64bit)/Vista(32bit・64bit)/XP(32bit・64bit) 【Macintosh※】Mac OS X 10.4.11以上、OS X 10.5以上/(※)Mac OS X対応のプリンタードライバーには、機能上制限があります。<br />* 縁無し印刷 : 有り</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
